INSERT INTO `controversy` VALUES (1,1,'2021-02-03 02:20:43','2021-03-01 02:00:46','코로나19 포상금 제도','코로나19 방역수칙 위반 사례 신고시, 포상금을 지급하는 제도가 생기며 포상금을 목적으로한 ‘코파라치’가 등장했습니다. 방역 사각지대 해소 vs 포상금 피해 사례 발생, 어떻게 생각하세요?',60,57),(2,1,'2021-02-03 12:37:25','2021-02-24 12:34:32','이익공유제','코로나19 이익공유제는 코로나로 이익을 얻은 업종·계층이 피해가 큰 업종·계층과 이익을 나누는 제도입니다. 사회적 고통을 분담하자는 의견과 기업경영에 대한 지나친 간섭이라는 의견이 있는데요, 어떻게 생각하세요?',35,73),(3,1,'2021-02-08 05:02:40','2021-02-20 02:00:46','공매도 금지','꿈에 그리던 코스피 3000시대지만 오는 3월, 공매도 재개 조치 종료를 앞두고 논란입니다. \"개인 투자자 피해발생\" vs \"주식시장 과열 방지 위해 필요\" 어떻게 생각하세요?',84,13),(4,1,'2021-02-09 05:20:27','2021-02-10 02:00:46','코로나19 포상금 제도','코로나19 방역수칙 위반 사례 신고시, 포상금을 지급하는 제도가 생기며 포상금을 목적으로한 ‘코파라치’가 등장했습니다. 방역 사각지대 해소 vs 포상금 피해 사례 발생, 어떻게 생각하세요?',30,30),(5,1,'2021-02-09 05:47:55','2021-02-10 02:00:46','자차 광고 승인','자기 소유 차량에 돈을 받고 광고 할 수 있는 안건이 승인 됐습니다. 광고 스티커를 붙이고 평소처럼 주행하면 월 10만 원 가량의 수익을 얻는데요, 여러분이라면 시도 하시겠습니까?',70,20);
