INSERT INTO `dict` VALUES (1,'공연성','공연성이란 불특정 다수가 인식 가능한 상태를 말합니다.\\n한사람에게 이야기했는데 여러 사람에게 전파될 가능성이 있다면 공연성이 성립합니다.'),(2,'선고','검사의 구형과 피고인의 변호사의 변론내용 등을 종합하여 판사의 재량에 따라 형을 확정지어 판결을 내리는 것을 말한다.\\n쉽게 말하자면, 피고인에 대한 직접적인 형별의 판결로 재판의 효력이 생기게 되는것이다.'),(3,'【피 고 인】','소송을 제기하는 자(원고)의 상대방(피고)으로 본래 소송을 당한 사람을 의미한다.'),(4,'【항 소 인】','제1심 판결에 불복할 때에 하는 신청하는 사람을 의미'),(5,'【상 고 인】','제2심 판결에 불복할 때에 하는 신청하는 사람을 의미'),(8,'공소외인','재판에서 심리할 대상이 되지 않는 사람'),(9,'공소 외 인','재판에서 심리할 대상이 되지 않는 사람'),(11,'상소','상소는 판결, 명령, 결정 등의 법원의 재판에 관하여 특정 기간 안에 불복의 의사를 표시하여 상급법원의 판단을 구하는 법률행위를 의미한다.'),(12,'공소사실','공소장에 기재된 구체적 범죄사실 및 심판의 대상으로 공소장에 범죄의 특별구성요건을\\n적시하여 검사가 심판을 청구하는 범죄사실을 뜻하는 단어이다.'),(13,'파기','상급법원이 하급법원의 재판을 깨뜨리는 것을 말함'),(14,'양형부당','범행의 동기나 결과에 비추어 볼 때 형량이 지나치게 가볍거나 무거움.'),(16,'자유심증주의','증거의 증명력, 즉 사실인정을 위한 증거의 실질적 가치를 법률로 규정하지 아니하고 법관의 자유로운 판단에 맡기는 원칙\\n(헌재 2009. 11. 26. 2008헌바25 결정).'),(17,'기각','수리된 소송을 종료하는 일'),(18,'각하','민사 소송법에서, 소나 상소가 형식적인 요건을 갖추지 못한 경우, \\n부적법한 것으로 하여 내용에 대한 판단 없이 소송을 종료하는 일.'),(19,'항소','제1심 판결에 불복할 때에 하는 신청'),(20,'상고','제2심 판결에 불복할 때에 하는 신청'),(22,'사실오인','형사 재판에서, 판사가 사실을 잘못 인정하는 일. 이것이 판결에 영향을 미칠 것이 분명하면 항소의 이유가 되고, \\n또한 그것이 중대한 일이면 상고의 이유가 된다.'),(23,'원심','현재의 재판보다 한 단계 앞서 받은 재판. 또는 그런 법원.\\n 항소(抗訴)에서는 초심의 재판, 상고(上告)에서는 항소의 재판을 이른다.'),(24,'변론','소송 당사자나 변호인이 법정에서 주장하거나 진술함. 또는 그런 주장이나 진술.'),(25,'사실인정','법원이 사실의 존재 여부를 판단하는 일. 재판의 기초가 된다.'),(26,'가납명령','재판이 확정된 후에는 집행할 수 없거나 집행하기에 곤란할 염려가 있다고 인정될 때\\n 직권 또는 검사의 청구에 의하여 피고인에게 벌금이나 과료 또는 추징에 상당한 금액의 가납을 명하는 일. \\n이것은 형의 선고와 동시에 판결로 선고하여야 한다.'),(27,'기소','법률 검사가 특정한 형사 사건에 대하여 법원에 심판을 요구하는 일.'),(28,'공판','기소된 형사 사건을 법원이 심리하는 일. 또는 그런 절차. \\n검사, 피고인, 변호인 들이 입회하여 증거를 제출하면 법원이 유죄ㆍ무죄를 판단하는 형사 소송의 중심 절차이다. \\n공개 심리주의, 구두주의, 변론주의의 원칙에 의하여 진행된다.'),(29,'청구범위','특허 출원이 허락된 경우에, 법적으로 보호받을 수 있는 권리에 해당하는 발명의 기술적 특징. 이는 독점권을 설정하여 주는 핵심 사항이다.'),(30,'패소자','소송에서 진 사람.');
/*!40000 ALTER TABLE `dict` ENABLE KEYS */;
UNLOCK TABLES;

