INSERT INTO `lawyer` VALUES (2,'(現) 경북 구미시청 자문변호사\n(現) 대구 지방고등법원 국선 변호인','의뢰인의 든든한 파트너로 최선의 결과를 보여드리겠습니다! 내 일 처럼 해결 방안을 찾기 위해 노력하고 있습니다. 젊고 건강한 정신으로 의뢰인의 고충을 해결하고자 겸손하지만 냉철한 이성으로 능동적이고 적극적으로 도와 드리겠습니다.','경북 구미시 3공단3로 302','김앤장','Y','이혼, 상속'),(166,'1988	제27회 사법시험 합격\n1994	변호사(대한민국)\n2007	SH법무법인 설립','상속과 이혼을 비롯한 제반 가사 분야와 재산관리 분야의 사건을 집중적으로 처리하여 왔습니다.','경상남도 진주시 이현동 13-36','SH법무법인','N','상속,이혼, 기타 가사사건 및 신탁, 재산관리 업무'),(167,'고려대학교 법학과 학사','주사위를 던질 기회가 있다면 주지 말고 던져라. 던지는 순간 최소한 한 칸은 전진한다.','부산광역시 북구 금곡동 효열로 111','몬스터법무법인','Y','지식재산권 소송, 영업비밀 및 기술유출 분쟁'),(168,'고려대학교 대학원 졸','사연이니, 사정이니 그 따위 건 집어치우고 사건만 보겠습니다','부산광역시 북구 금곡동 효열로 111','몬스터법무법인','Y','금융기관 인수합병 및 구조조정'),(169,'이화여자대학교 법학과 학사\r\n상속관련소송 다수 승소','여러분을 제 가족처럼 여기겠습니다','부산광역시 북구 금곡동 효열로 111','몬스터법무법인','Y','가정폭력범죄'),(170,'(現) 부산 국선변호사 ','여러분의 돈을 제 돈처럼 여기겠습니다','서울특별시 강남구 선릉로 428','멀티법무법인','Y','일반금융, 자본시장 및 기업금융'),(171,'1998년 제40회 사법시험 합격 \r\n(現) 법무법인 숭인 대표 변호사.','사이버욕설, 사이버폭력','경상남도 창원시 마산합포구 산호동 36-5','명신로펌','N','사이버욕설, 사이버폭력'),(172,'(現) 육군 법무관	\r\n(現) 대구 지방고등법원 국선 변호인','매장 간판 관련 소송 도와드립니다','대구광역시 북구 산격1동 846-33','유명성장법무법인','Y','상표권분쟁, 브랜드도용, 가전제품 관련 사기'),(173,'송파세무서 이의신청심의위원','당신의 소중한 돈을 지켜드립니다','울산광역시 북구 정자동 181-1번지','송무법무법인','N','강력범죄, 계획적범죄, 조직적범죄'),(180,NULL,NULL,'?','?','N',NULL);
