INSERT INTO `matching` VALUES (133,174,171,'2021-02-17 06:06:57','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">실명과 동일한 닉네임을 사용하고 있는 유저입니다.</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">본인의 실명을 거론하며 부모님을 들먹이는 욕설을 끊임없이 뱉어내던 유저가 있어 질문을 올립니다. 특정성이라고는 실명 닉네임밖에 없는데 고소가 가능한 부분인지 여쭙고 싶습니다. 욕설은 모두 패드립이었고, 채팅로그를 따겠다는 경고 후에도 욕설은 계속되었습니다.</span><br></p>','신청','2021-02-22 06:00:00',NULL,'게임 욕설로 인한 고소','정보통신/기술'),(134,175,169,'2021-02-17 06:09:19','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">결혼한 지 3년 된 주부입니다. </span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">남편이 결혼 초기부터 화가 나면 물건을 던지는 행동을 보이더니 최근에는 저의 신체에 직접 폭력을 행사하고 있습니다. 너무나 괴로운데... 가정폭력에 대하여 어떻게 대처해야 하는지 궁금합니다.</span><br></p>','신청','2021-02-23 04:30:00',NULL,'갈수록 남편의 폭력이 심해지는데... 가정폭력 피해는 어떻게 대처하나요?','가정'),(136,176,172,'2021-02-17 06:17:01','<p>사용 상표가 대상상표와 외관, 호칭, 관념 모두 유사하지 않다고 하더라도 전체적인 구성, 아이디어, 모티브 등이 동일 유사하여 대상상표가 쉽게 연상된다는 등의 점이 있으면 어떻게 되는 건가요?<br></p>','신청','2021-02-26 08:00:00',NULL,'상표의 유사성','정보통신/기술'),(137,176,2,'2021-02-17 06:18:54','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">상속개시 후 발생한 상속재산의 과실도 상속재산으로서 분할 대상에 해당하나요?</span><br></p>','신청','2021-02-19 05:10:00',NULL,'상속개시 후 발생한 상속재산','가정'),(138,174,167,'2021-02-17 06:20:40','<p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">안녕하세요 저는 해외구매대행업을 하고 있습니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">레플 아이템을 올렸는데 그것이 판매가 되었습니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">하지만 통관시 지식재산권침해에 걸려 폐기처분을 해야한다고 통보받게되었습니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">그럼 저는 아이템을 산 고객에게 환불을 해줘야하는건지 안해줘도 되는건지 궁금합니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">고객도 레플아이템이란 사실을 알고 구매를 하였습니다.</p>','접수','2021-02-17 17:00:00','','해외구매대행시 지식재산권침해 아이템에 대한 환불 여부','정보통신/기술'),(139,174,173,'2021-02-17 06:22:06','<p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">예전에 학교폭력 가해자였습니다. 하지만 그친구도 저한테 상처를 주어 지금도 많이 우울하고 하루하루 너무 버티기 힘들정도 입니다 </span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">그친구도 저랑 싸울때는 똑같이 화냈는데 말이죠 학폭 가해자가 된 이유는 제가 평소에 쓰던 말투때문이래요 학폭위는 안열렸고 사과하고 끝냈습니다</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">그친구도 학교폭력실태조사를 하잖아요 그친구가 2019년 2학기때부터 학교폭력을 당한적이 있습니까? 라고 할때 예 라고 대답하면 저는 어떻게 되는건가요?</span><br></p>','신청','2021-02-16 15:01:00',NULL,'학교폭력','가정'),(140,174,168,'2021-02-17 06:23:19','<p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">안녕하세요. 저는 30여명 남짓 다니는 여행사에 재직중입니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">현재 회사는 코로나 상황으로 휴업상태이며, 20여명의 직원들은 정부지원으로 무급 휴직중이고, 8명정도의 인원이 70% 급여로 주 3회 출근을 하고 있습니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">조만간 구조조정을 통하여 직원 감축을 한다고 하는데 몇가지 궁금한 사항이 있습니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">첫째, 구조조정 대상자를 선정해서 면담 후 권고사직으로 진행이 된다고 하는데 면담에서 권고사직을 거부하면 어떻게 되나요?</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">둘째, 구조조정 대상자가 되지 못했지만 앞으로의 불확실한 상황 때문에 회사를 그만 두고 싶으면 구조조정 대상자에 포함 시켜달라고 요구를 할 슈 있는지 .. 아니면 구조조정 될때 자진 퇴사를 하면 실업급여 대상이 안되는지 궁금합니다.</span><br></p>','접수','2021-02-16 05:15:00','','구조조정 대상자에 대한 질문입니다','근로/노동'),(141,178,2,'2021-02-17 06:24:17','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">협의이혼의사 철회신고서 접수 후 제출된 협의이혼신고서가 수리된 경우 이혼은 유효한가요?</span><br></p>','종료','2021-02-17 16:10:00','특이사항 없음','협의이혼의사 철회신고서 접수 후 제출된 협의이혼신고서가 수리된 경우의 이혼','가정'),(142,177,166,'2021-02-17 06:26:41','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">상속인의 존부가 불분명한 경우에 있어 상속재산관리인의 선임 청구인에게 상속재산관리인의 보수의 예납을 명할 수 있나요?</span><br></p>','','2021-02-16 15:29:00','','상속인의 존부가 불분명한 경우','가정'),(143,176,2,'2021-02-17 06:27:41','<p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">5년전&nbsp; 아이엄마와 협의이혼했습니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">아이는 초등생 저학년 고학년 2명입니다</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">당시 이혼할때&nbsp; 제가 조그만한 회사에서&nbsp;최저임금만 받는 형편이였고 재산분할 이런거없이 제가 몸만나와서 방얻으며 월세내야하고 생활해야했기에&nbsp;&nbsp;협의이혼 과정에서&nbsp; 양육비는 60만원 주기로 합의하였습니다</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">그래서 처음에 60만원씩 꼬박꼬박주다가 제가 월급이&nbsp; 조금 오르게되고&nbsp; 반대로 애엄마는 아웃소싱통해 비정규직으로 2년만다 회사를 옮기며 생활하기에 그게 안스러워 &nbsp;양육비 이외에 계절마다 아이들 용돈이며 외식비 옷이나 통신비&nbsp; 부담하고 양육비도 70만원으로&nbsp; 알아서 더주었습니다.&nbsp;&nbsp; 정말 열심히 일해서 나한테 쓸꺼 안써가며&nbsp;그후엔 또 알아서 &nbsp;80만원씩 계속 보내주었고요.&nbsp;&nbsp;&nbsp;그외 애엄마집에 애들이 필요한&nbsp;TV &nbsp;컴퓨터나 노트북같은&nbsp; 목돈들어가는 용품도 제가 다사주었고요&nbsp;&nbsp;요 근래 몇달은 90만원으로 주고있습니다&nbsp;&nbsp; 하지만&nbsp; 코로나사태및 회사경영악화로 월급감소및 퇴사를&nbsp; 해야될 상황이 왔습니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">그래서&nbsp; 양육비를 처음 합의한대로 다시 60만원씩만 보내준다고하니&nbsp;&nbsp; 애엄마쪽에서는 안된다고하며 양육비 더달라는소송도 고려한다는 입장입니다.</p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></p><p style=\"margin-bottom: 0px; font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">현재 저는 3월에 퇴사예정이고요 퇴사하면 알바나 재취업을&nbsp; 하게되면 최저임금으로 적용받아 일을할게 될것같습니다&nbsp;&nbsp; 반대로 애엄마는 이혼후보다 지금이&nbsp; 사정이 더 좋아졌고 직장도 정규직으로 전화되어 안정적으로 일을하고있습니다</p>','신청','2021-02-16 20:25:00','','협의이혼후 양육비 문제로 질문드립니다','가정'),(144,177,172,'2021-02-17 06:29:11','<p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">현재 군 복무 중에 있는 사람입니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">담당간부와 선임들의 부조리와 괴롭힘이 장난과 도를 넘어 형사소송을 결심하게 되었습니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">군대 내에서도 자체적으로 부조리와 괴롭힘을 처벌하는 방법이 있습니다만, 제대를 기다렸다가 사회의 법으로 이 일을 다뤘으면 좋겠기에 이렇게 글을 올립니다.</span></p><p><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">1. 형사소송을 진행하게 되면 2020년 4월일 것입니다.</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">2. 군대 내에서는 사진촬영, 녹음이 위법이라서</span><br style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\">제가 할 수 있는게 육하원칙으로 당시 상황을 구체적으로 기록해놓는 방법 밖에 없는데 혹시 따로 준비 할 수 있는 게 있나 궁금합니다.</span><span style=\"font-family: &quot;Helvetica Neue&quot;, &quot;Apple SD Gothic Neo&quot;, 나눔고딕, NanumGothic, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 16px;\"><br></span><br></p>','신청','2021-02-20 00:52:00',NULL,'군대 안에서 형사소송을 준비하려면','가정'),(145,178,172,'2021-02-17 06:35:31','<p>약 한달 전 쯤에 새로운 치킨 메뉴를 만들어서 가게에 내놓았습니다.&nbsp;</p><p>치킨에다가 위에 달걀 지단을 부쳐서 얇게 썰어 고명을 올린 메뉴라 \"황금지단\"이라고 올려놓았는데,</p><p>최근 온라인상에서 불순한 게시글로 해당 메뉴를 욕하는 어처구니 없는 일이 일어났습니다.</p><p><br></p><p>달걀을 얇게 썰어서 치킨 위에 올린게 마치 자식을 어미 위에 올린 것과 다를 바가 없지 않느냐면서 폄하하였습니다.</p><p>제 메뉴가 그런 형태로 받아들여지는 건 아무래도 좋지만, 타 매장에서 불순한 목적으로 올린 것 같아 고소해보고자 합니다.</p><p>명예훼손으로 고소가 가능할지 검토 부탁드립니다.</p>','신청','2021-02-19 17:40:00',NULL,'명예훼손으로 고소할 수 있는지 상담받고싶습니다.','금융'),(146,177,170,'2021-02-17 06:51:28','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">금융기관이 본인확인절차 등을 제대로 거치지 않아 모용계좌가 개설되었습니다. 이 경우 금융기관에 모용계좌를 통하여 입·출금된 금원에 대하여 손해배상책임이 인정되나요?</span><br></p>','신청','2021-02-25 04:30:00',NULL,'금융기관이 본인확인절차 등을 제대로 거치지 않아 모용계좌가 개설된 경우 금융기관은 손해배상책임이 있나요?','금융'),(147,174,170,'2021-02-17 06:57:23','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">금융기관 임직원이 임의로 예금주의 예금계좌에서 5천만원을 인출하였습니다. 업무상배임죄가 성립하나요?</span><br></p>','신청','2021-02-26 06:15:00',NULL,'금융기관 임직원이 임의로 예금주의 예금계좌  인출','금융'),(148,178,173,'2021-02-17 07:20:20','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">경제적 상황이 어려워 보험금을 타려고 고의적으로 교통사고를 유발하고, 보험회사로부터 보험금을 지급받았습니다. 사기죄에 해당하나요?</span><br></p>','신청','2021-03-04 18:00:00',NULL,'고의적으로 교통사고를 유발하여 보험금을 지급받은 경우 사기죄의 성부','교통/운전'),(149,178,169,'2021-02-17 07:32:45','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">시어머니가 온갖 모욕에 폭행으로 저를 정말 심하게 괴롭히십니다. 남편은 알면서도 저보고 참으라는데 도저히 어머님을 모실 수 없다고 했더니 저보고 나쁘다고 하네요. 저는 정말 정신병이 걸릴 지경인데 이런 것도 이혼 사유가 될 수 있나요?</span><br></p>','신청','2021-02-19 02:00:00',NULL,'시어머니의 심한 모욕과 폭행을 이유로 이혼을 할 수 있나요?','가정'),(150,175,166,'2021-02-17 07:34:41','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">아내가 다른 남자를 만나는것을 저에게 들켰고,, 그 날 부로 이혼을 준비중입니다. 둘 사이에는 6살짜리 아들이 하나 있고요.</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">금전적인 것이나 물품 분배 같은 것들은 상당수 합의를 한 상황인데, 중요한 양육권을 정하지 못했습니다. 서로 자신이 데려가려 하고 있는 상황입니다.</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">맞벌이 부부이지만 아내는 아르바이트여서 벌이가 좋지는 않습니다. 처가도 형편이 넉넉치 않아 제가 번 돈에서 자주 지원을 해드릴 정도였고요. 다만 아내의 근무 시간이 저보다는 짧아서 아들과 보낸 시간은 더 길고요. 둘 다 일 나가있는 동안에는 장모님이 많이 봐주셨었습니다.</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><br style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">만약 이 것을 법적 판단에 넘긴다고 할 때 양육권을 가져가는 기준이 어떤 요소에 의해 좌우되는지 궁금하고, 대략적으로 위와 같은 상황에서 제가 양육권을 가질 수 있을 지 궁금합니다.</span><br></p>','신청','2021-02-22 01:30:00',NULL,'아들의 양육권을 얻을 수 있을 지 궁금합니다.','가정'),(151,175,167,'2021-02-17 07:40:12','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Noto Sans Korean&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px;\">얼마 전 모 기업에서 사업기획을 목적으로 홍보영상물 공모전을 벌였습니다. 저는 공모에 참여하여 당선되었는데 회사에서는 포상 형식으로 보상을 하면서 영상물에 대한 지식 재산권을 이전해달라고 했습니다. 지식 재산권의 귀속을 강요하는 구인자는 처벌될 수 있나요?</span><br></p>','신청','2021-02-18 10:00:00',NULL,'저작물에 대하여 지식재산권의 귀속을 강요','정보통신/기술'),(154,174,167,'2021-02-17 18:12:52','<h3>누가 제가 올린 블로그 포스트를 무단으로 게시하였는데, 이에 대한 법률 자문을 요청합니다.</h3><p><img src=\"/api/data/101\" style=\"width: 1661px;\"><br></p>','예약','2021-02-17 18:30:00','예약시간 변경되었습니다. 확인해주세요.','저작권 침해 관련 자문','정보통신/기술');
