INSERT INTO `message` VALUES (1,'안녕하세요. 변호사 박수현이라고 합니다.',142,166,'2021-02-17 06:41:20'),(2,'문의 주신 \"상속인의 존부가 불분명한 경우\"에 대해 알려드리고자 합니다.',142,166,'2021-02-17 06:41:46'),(3,'네! 안녕하세요. 그런데 따로 자문비를 드려야하는지요?;;',142,177,'2021-02-17 06:44:26'),(4,'일반적인 자문은 무료이고, 방문상담인 경우에는 따로 비용이 청구됩니다. 그러니 안심하셔도 됩니다! ^^*',142,166,'2021-02-17 06:45:04'),(5,'다시 본론으로 돌아가서...',142,166,'2021-02-17 06:45:12'),(6,'자문 주신 내용에 대해서는 다음과 같이 글을 준비해 두었어요.',142,166,'2021-02-17 06:45:26'),(7,'상속재산의 관리와 청산\n\n관리인의 선임 - 상속재산관리인은 피상속인의 상속인임을 요하지 않는다.\n\n상속재산관리인은 후에 나타날 수 있는 상속인 또는 포괄적 수유자의 법정대리인의 지위를 가진다.\n\n​\n\n상속재산관리인의 권리와 의무\n\n관리인은 원칙적으로 부재자를 위한 재산관리인과 동일한 권리, 의무를 가지므로, \n\n부재자를 위한 재산관리인에 관한 규정이 준용된다.\n\n​\n\n상속재산의 국가귀속\n\n민법에 정한 기간 내에 상속권을 주장하는 자가 없는 때에는 상속재산은 국가에 귀속하며\n\n국가는 적극재산만을 취득하고 채무는 부담하지 않는다.\n\n',142,166,'2021-02-17 06:46:04'),(8,'상속재산관리인으로서 피상속인의 입장에 있으신지 상속인과의 정확한 관계가 어떻게 되시는지 파악이 중요합니다.',142,166,'2021-02-17 06:47:12'),(9,'아... 그렇군요., 그 정보는 어떻게 확인하면 될까요??? 등본상으로는 현재 분리가 되어 있어서 따로 내기가 쉽지 않은데',142,177,'2021-02-17 06:47:55'),(10,'혈연 관계이시면은 혈연 관계를 증명할만한 것을 제출하시면 되는데요. 주로 가족관계증명서라던가,  출생 당시에 있었던 병원에서 출생신고서나 기록이 있는지 확인하시고 제출하시면 됩니다.',142,166,'2021-02-17 06:49:36'),(11,'아. 그렇군요. 친절하게 답변해주셔서 정말 감사합니다!',142,177,'2021-02-17 06:49:49'),(12,'도움이 되셨다니 다행입니다.',142,166,'2021-02-17 06:49:59'),(13,'박수현 변호사였습니다.',142,166,'2021-02-17 06:50:11'),(14,'안녕하십니까. 변호사 최현석입니다.  ',140,168,'2021-02-17 15:57:12'),(15,'안녕하세요. 변호사 임윤선이라고 합니다.',141,2,'2021-02-17 16:36:30'),(16,'문의해 주신 \"협의이혼의사 철회신고서 접수 후 제출된 협의이혼신고서가 수리된 경우의 이혼\"에 대해 답변해 드리겠습니다',141,2,'2021-02-17 16:36:55'),(17,'대법원은 \"부부가 이혼하기로 협의하고 가정법원의 협의이혼의사 확인을 받았다고 하더라도 호적법에 정한 바에 의하여 신고함으로써 협의이혼의 효력이 생기기 전에는 부부의 일방이 언제든지 협의이혼의사를 철회할 수 있는 것이어서, 협의이혼신고서가 수리되기 전에 협의이혼의사의 철회신고서가 제출되면 협의이혼신고서는 수리할 수 없는 것이므로, 설사 호적공무원이 착오로 협의이혼의사 철회신고서가 제출된 사실을 간과한 나머지 그 후에 제출된 협의이혼신고서를 수리하였다고 하더라도 협의상 이혼의 효력이 생길 수 없다(대법원 1994. 2. 8. 선고 93도2869 판결).\"라고 판시하고 있습니다.',141,2,'2021-02-17 16:39:12'),(18,'즉 이혼은 유효하지 않은 상태입니다.',141,2,'2021-02-17 16:40:07'),(19,'이걸로 답변이 되셨을까요?',141,2,'2021-02-17 16:40:17'),(20,'넵! 답변 감사드립니다. ',141,178,'2021-02-17 16:41:49'),(21,'혹여나 차후 다른 문의사항이 있으시면 개인 사무실로 연락을 주시면 상세히 답변해 드리겠습니다',141,2,'2021-02-17 16:43:42'),(22,'감사합니다. 임윤선 변호사였습니다',141,2,'2021-02-17 16:44:01'),(23,'감사합니다',141,178,'2021-02-17 16:44:36'),(30,'정확한 상담을 위해 자문요청글에서 언급하신 블로그 포스트링크 공유 부탁드립니다.\n',154,167,'2021-02-17 18:53:01'),(31,'https://blog.naver.com/doggodi303/220051894686',154,174,'2021-02-17 18:53:14'),(32,'확인했습니다.',154,167,'2021-02-17 18:53:23'),(33,'안녕하세요 박형식 변호사입니다.',138,167,'2021-02-18 00:51:36'),(34,'문의해 주신 \"질문	\n해외구매대행시 지식재산권침해 아이템에 대한 환불 여부\"에 대해 답변해 드리겠습니다',138,167,'2021-02-18 00:52:29'),(35,'네',138,174,'2021-02-18 00:52:34'),(36,'우선 침해품(모조품)을 구매하는 행위는 지식재산권 침해에 해당하지 않습니다. 다만, 침해품을 직접 제작하여 판매하거나 구매하여 재판매하는 행위는 지식재산권 침해에 해당합니다.',138,167,'2021-02-18 00:53:07'),(37,'그렇군요',138,174,'2021-02-18 00:53:14'),(38,'본 사안에서, 판매자의 행위가 문제되어 폐기처분이 된 것이므로, 환불처리를 해드려야 하는 것이 맞을 것 같은데 이러한 리스크에 대해 사전공지를 한 경우라면 달리 볼 수 있을 것 같습니다.',138,167,'2021-02-18 00:54:34'),(39,'궁금하던 점은 해결되셨나요?',138,167,'2021-02-18 00:55:27'),(41,'네 답변 감사드립니다',138,174,'2021-02-18 00:57:23'),(42,'다행이내요 다른 궁금한 점이 있으시면 따로 연락주시면 해결해드리겠습니다',138,167,'2021-02-18 00:58:54'),(43,'이상 박형식 변호사였습니다',138,167,'2021-02-18 00:59:04');
